import React, { useEffect } from 'react'
import '../css/Dashboard.css'
import { useState } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Card, Button } from 'react-bootstrap';
import { Carousel } from 'react-bootstrap';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faFacebookSquare, faYoutube } from '@fortawesome/free-brands-svg-icons';
import { ToastContainer, toast } from 'react-toastify';
import Slidebar from './Slideshow/Slidebar';
import Footer from './Footer/Footer';


function CateringReqForm() {

    const img1 = require("../Img/catering1.jpeg");
    const [firstName, setFirstName] = useState('');
    const [lastName, setLastName] = useState('');
    const [phoneNumber, setPhoneNumber] = useState('');
    const [homeNumber, setHomeNumber] = useState('');
    const [email, setEmail] = useState('');
    const [formValid, setFormValid] = useState(true);
    const [formValidPhone, setFormValidPhone] = useState(true);
    const [addressLine, setaddressLine] = useState('');
    const [state, setState] = useState('');
    const [city, setCity] = useState('');
    const [zipcode, setZipcode] = useState('');
    const [dateOfEvent, setDateOfEvent] = useState('');
    const [numberOfPeople, setNumberOfPeople] = useState('');
    const [mealTime, setMealTime] = useState('');
    const [cuisineType, setCuisineType] = useState('');
    const [foodItems, setFoodItems] = useState('');
    const [spiceLevel, setSpiceLevel] = useState('');
    const [Name, setName] = useState('');
    const [comments, setComments] = useState('');
    const [formValidEmail, setFormValidEmail] = useState(true);
    const [showModal, setShowModal] = useState(false)
    const [deliveryType, setDeliveryType] = useState('');
    const [zipformValid, setzipFormValid] = useState(true);
    const [deliveryPickTime, setdeliveryPickTime] = useState('')

    useEffect(() => {
        // Check if status is true in local storage
        const status = localStorage.getItem("status");
        if (status === "true") {
            // If status is true, fetch data from local storage and set the state
            const formData = JSON.parse(localStorage.getItem("formData"));

            // Set form data from local storage
            setFirstName(formData.firstName);
            setLastName(formData.lastName);
            setPhoneNumber(formData.phoneNumber);
            setHomeNumber(formData.homeNumber);
            setEmail(formData.email);
            setaddressLine(formData.street);
            setState(formData.state);
            setCity(formData.city);
            setZipcode(formData.zipcode);
            setDateOfEvent(formData.dateOfEvent);
            setNumberOfPeople(formData.numberOfPeople);
            setMealTime(formData.mealTime);
            setCuisineType(formData.cuisineType);
            setFoodItems(formData.foodItems);
            setSpiceLevel(formData.spiceLevel);
            setName(formData.Name);
            setComments(formData.comments);
            setDeliveryType(formData.deliveryType);
            localStorage.setItem("status", "false");
        }
    }, []);

   const handleDownloadPDF = () => {
        try {
            // Convert the base64 string to a Uint8Array
            const pdfBase64 = '';
            const byteCharacters = atob(pdfBase64);
            const byteNumbers = new Array(byteCharacters.length);
            for (let i = 0; i < byteCharacters.length; i++) {
              byteNumbers[i] = byteCharacters.charCodeAt(i);
            }
            const byteArray = new Uint8Array(byteNumbers);
      
            // Create a Blob from the Uint8Array
            const blob = new Blob([byteArray], { type: 'application/pdf' });
      
            // Create a temporary URL for the Blob
            const blobUrl = window.URL.createObjectURL(blob);
      
            // Create a temporary anchor element
            const downloadLink = document.createElement('a');
      
            // Set the href attribute to the Blob URL
            downloadLink.href = blobUrl;
      
            // Set the download attribute to force download with the file name
            downloadLink.download = 'Menu-List.pdf';
      
            // Append the anchor element to the body
            document.body.appendChild(downloadLink);
      
            // Click the anchor element to trigger the download
            downloadLink.click();
      
            // Remove the anchor element from the body
            document.body.removeChild(downloadLink);
      
            // Release the temporary URL created for the Blob
            window.URL.revokeObjectURL(blobUrl);
          } catch (error) {
            console.error('Error downloading PDF:', error);
          }
    };
    
    


    const handleDeliveryTypeChange = (e) => {
        const value = e.target.value;
        setDeliveryType(value);
        // Reset validation state if the selected value is not empty
        setFormValid(value !== '');
    };

    const handleZipcodeChange = (e) => {
        const enteredValue = e.target.value;

        // Check if the entered value is numeric
        if (/^\d+$/.test(enteredValue) || enteredValue === "") {
            setZipcode(enteredValue);
            setzipFormValid(true); // Reset form validation
        } else {
            setzipFormValid(false); // Set form validation to false if non-numeric value entered
        }
    }

    const handleHomeNumberChange = (e) => {
        const value = e.target.value;
        // Check if the entered value is a positive integer
        if (/^\d+$/.test(value) || value === '') {
            setHomeNumber(value);
            setFormValid(true); // Reset validation state if the input is valid
        } else {
            setFormValid(false); // Set validation state to false if the input is invalid
        }
    };

    // Validation function for phone number
    const handlePhoneNumberChange = (e) => {
        const value = e.target.value;

        if (/^\d+$/.test(value) || value === '') {
            setPhoneNumber(value);
            if (/^\d{10}$/.test(value)) {

                setFormValidPhone(true);
            } else {
                setFormValidPhone(false);
            }
        }
    };

    // Validation function for email
    const handleEmailChange = (e) => {
        const value = e.target.value;
        setEmail(value);
        // Example validation: Check if the email contains @ symbol
        if (value.includes('@')) {
            setFormValidEmail(true);
        } else {
            setFormValidEmail(false);
        }
    };

    // Submit handler
    const handleSubmit = async () => {

        if (!firstName || !lastName || !phoneNumber || !email || !addressLine || !state || !homeNumber || !city || !zipcode || !dateOfEvent || !numberOfPeople || !mealTime || !cuisineType
            || !foodItems || !spiceLevel || !deliveryType || !deliveryPickTime) {
            setFormValid(false);
            return;
        }

        const formData = {
            firstName,
            lastName,
            phoneNumber,
            homeNumber,
            email,
            addressLine,
            state,
            city,
            zipcode,
            dateOfEvent,
            numberOfPeople,
            mealTime,
            cuisineType,
            foodItems,
            spiceLevel,
            deliveryType,
            deliveryPickTime,
            Name,
            comments
        };

        try {
            // Make a POST request to the backend API endpoint
            const response = await fetch('https://jssnode.onrender.com/cateringreq', {
                method: 'POST',
                headers: {
                    'Content-Type': 'application/json',
                },
                body: JSON.stringify(formData),
            });

            // Check if the request is successful
            if (response.ok) {
                // Parse the response data
                const data = await response.json();
                setShowModal(true);
                document.getElementById("submitBtn").disabled = false;
                // Log a success message with the saved data
                console.log('Catering Req data saved successfully:', data);
                // Set form validity state to true
                setFormValid(true);
            } else {
                // If the request fails, parse and log the error message
                document.getElementById("submitBtn").disabled = false;
                const errorData = await response.json();
                console.error('Error saving Catering req data:', errorData.error);
            }
        } catch (error) {
            // If an error occurs during the fetch operation, log the error
            console.error('An error occurred while saving Catering req data:', error);
        }

    };

    const handleDeliveryTimeChange = (e) => {
        const deliveryTime = e.target.value;
        setdeliveryPickTime(deliveryTime);
        
      };

    const closeModal = () => {
        setShowModal(false);
        setFirstName('');
        setLastName('');
        setPhoneNumber('');
        setHomeNumber('');
        setEmail('');
        setaddressLine('');
        setState('');
        setCity('');
        setZipcode('');
        setDateOfEvent('');
        setNumberOfPeople('');
        setMealTime('');
        setCuisineType('');
        setFoodItems('');
        setSpiceLevel('');
        setComments('');
        setDeliveryType('');
        setdeliveryPickTime('')
        setName('');
    }

    return (
        <>
            <div className='container-fluid bg' style={{ color: 'white' }}>
                <div className='container'>
                    <div className='d-flex justify-content-center align-item-center mt-5'>
                        <div className='py-5 pb-5 text-center mt-5'>
                            <div className='mt-5'>
                                <h3 className='h styleHeading'>Catering Request </h3>
                            </div>
                            <div className='mt-3'>
                                <p className='paraContent'>“I am in the Light. I am the Light. The Light is in Me.<br></br>
                                    The Light is Myself.”</p>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
            <div className='container-fluid px-0'>
                <Slidebar img1={img1}/>
            </div>

            <div className='container-fluid px-0 ' style={{ color: 'black' }}>
                <div className='container'>
                    <div className='justify-content-center align-item-center'>
                        <div className='row mx-0 '>
                            <div className='col-lg-12'>
                                <div className='text-center'>
                                    <div className='justify-content-center align-item-center'>
                                        <div className='mt-5'>
                                            <div>
                                                <h2 className='styleHeadingForm' style={{ margin: '0' }}>Catering ordering request:</h2><hr class="separator separator--line" style={{ margin: '0' }} />
                                            </div>
                                            <div className='mx-auto' style={{ paddingTop: 40 }}>
                                                <p className='priPass'> Welcome to the JSS Spiritual Mandir's catering service, where we specialize in crafting exquisite vegetarian dishes to elevate your events. Our culinary offerings blend tradition with innovation, ensuring every bite is a flavorful delight. From sacred ceremonies to community gatherings, trust us to cater to your vegetarian culinary needs with love and expertise. Experience the essence of spirituality through our delicious creations. Place your order with JSS Spiritual Mandir today and let us add a touch of divine flavor to your celebrations.</p><br></br>
                                            </div>
                                        </div>
                                    </div>
                                </div>
                            </div>
                            <div className='col-lg-12 mt-5'>
                                <div className='pb-5 text-center'>
                                    <div className='justify-content-center align-item-center'>
                                        <div className=''>
                                            <div>
                                                <h4 className='styleHeadingForm' style={{ margin: '0' }}>Catering Request Form</h4>
                                            </div>
                                            <hr class="separator separator--line" style={{ margin: '0' }} />
                                            <div className='container' style={{ paddingTop: 40 }}>
                                                <div className='row'>
                                                    <div className="col-lg-6  mx-auto ">
                                                        <div className="text-left">
                                                            <p className='PersonalPass' style={{ margin: '0' }}>Personal Details</p><hr className='Personal Personal--line' style={{ margin: '0' }} />

                                                            {/* Personal Details Fields */}
                                                            {/* First Name */}
                                                            <div className="text-center mt-3">
                                                                <div className='text-left'>
                                                                    <label htmlFor="First Name" className="form-label">First Name<span className='text-danger'>*</span></label>
                                                                </div>
                                                                <input type='text' id='firstName' value={firstName} placeholder='Enter your First Name' className={`form-control ${(!firstName && !formValid) && 'border-bottom border-danger'}`} onChange={(e) => setFirstName(e.target.value)} style={{ border: 'none', borderBottom: '1px solid gray', borderRadius: '0' }}></input>
                                                            </div>
                                                            {/* Last Name */}
                                                            <div className="text-center">
                                                                <div className='text-left mt-3'>
                                                                    <label htmlFor="Last Name" className="form-label">Last Name<span className='text-danger'>*</span></label>
                                                                </div>
                                                                <input type='text' id='lastName' value={lastName} placeholder='Enter your Last Name' className={`form-control ${(!lastName && !formValid) && 'border-bottom border-danger'}`} onChange={(e) => setLastName(e.target.value)} style={{ border: 'none', borderBottom: '1px solid gray', borderRadius: '0' }}></input>
                                                            </div>
                                                            {/* Phone Number */}
                                                            <div className="text-center">
                                                                <div className='text-left mt-3'>
                                                                    <label htmlFor="phoneNumber" className="form-label">Phone Number<span className='text-danger'>*</span></label>
                                                                </div>
                                                                <input
                                                                    type='text'
                                                                    id='phoneNumber'
                                                                    value={phoneNumber}
                                                                    placeholder='Enter your Phone number'
                                                                    className={`form-control ${(!phoneNumber && !formValid) && 'border-bottom border-danger'}`}
                                                                    onChange={handlePhoneNumberChange}
                                                                    style={{ border: 'none', borderBottom: '1px solid gray', borderRadius: '0' }}
                                                                />
                                                                {!formValidPhone && <div className="text-danger">Phone number must be exactly 10 digits</div>}
                                                            </div>
                                                            {/* Home Number */}
                                                            <div className="text-center">
                                                                <div className='text-left mt-3'>
                                                                    <label htmlFor="Home number" className="form-label">Home Number<span className='text-danger'>*</span></label>
                                                                </div>
                                                                <input
                                                                    type='text'
                                                                    id='homeNumber'
                                                                    value={homeNumber}
                                                                    placeholder='Enter your Home number'
                                                                    className={`form-control ${(!homeNumber && !formValid) && 'border-bottom border-danger'}`}
                                                                    onChange={handleHomeNumberChange}
                                                                    style={{ border: 'none', borderBottom: '1px solid gray', borderRadius: '0' }}
                                                                />
                                                                {(!homeNumber && !formValid) && (
                                                                    <div className='text-danger'>*Please enter a positive integer</div>
                                                                )}
                                                            </div>
                                                            {/* Email */}
                                                            <div className="text-center">
                                                                <div className='text-left mt-3 '>
                                                                    <label htmlFor="email" className="form-label">Email<span className='text-danger'>*</span></label>
                                                                </div>
                                                                <input
                                                                    type='email'
                                                                    id='email'
                                                                    value={email}
                                                                    placeholder='Enter your email'
                                                                    className={`form-control mb-2 ${(!email && !formValid) && 'border-bottom border-danger'}`}
                                                                    onChange={handleEmailChange}
                                                                    style={{ border: 'none', borderBottom: '1px solid gray', borderRadius: '0' }}
                                                                />
                                                                {!formValidEmail && <div className="text-danger">Please enter a valid email address</div>}
                                                            </div>
                                                        </div>
                                                        <div className="text-left mt-5">
                                                            <p className='PersonalPass' style={{ margin: '0' }}>Home Address</p><hr className='Personal Personal--line' style={{ margin: '0' }} />

                                                            {/* Home Address Fields */}
                                                            {/* Address Line1 */}
                                                            <div className="text-center mt-3">
                                                                <div className='text-left'>
                                                                    <label htmlFor="addressLine" className="form-label">Address Line 1<span className='text-danger'>*</span></label>
                                                                </div>
                                                                <input type='text' id='addressLine' value={addressLine} placeholder='Enter Address Line 1' className={`form-control ${(!addressLine && !formValid) && 'border-bottom border-danger'}`} onChange={(e) => setaddressLine(e.target.value)} style={{ border: 'none', borderBottom: '1px solid gray', borderRadius: '0' }}></input>
                                                            </div>
                                                            {/* State */}
                                                            <div className="text-center">
                                                                <div className='text-left mt-3'>
                                                                    <label htmlFor="state" className="form-label">State<span className='text-danger'>*</span></label>
                                                                </div>
                                                                <input type='text' id='state' value={state} placeholder='Enter State' className={`form-control ${(!state && !formValid) && 'border-bottom border-danger'}`} onChange={(e) => setState(e.target.value)} style={{ border: 'none', borderBottom: '1px solid gray', borderRadius: '0' }}></input>
                                                            </div>
                                                            {/* City */}
                                                            <div className="text-center">
                                                                <div className='text-left mt-3'>
                                                                    <label htmlFor="city" className="form-label">City<span className='text-danger'>*</span></label>
                                                                </div>
                                                                <input type='text' id='city' value={city} placeholder='Enter City' className={`form-control ${(!city && !formValid) && 'border-bottom border-danger'}`} onChange={(e) => setCity(e.target.value)} style={{ border: 'none', borderBottom: '1px solid gray', borderRadius: '0' }}></input>
                                                            </div>
                                                            {/* Zipcode */}
                                                            <div className="text-center">
                                                                <div className='text-left mt-3'>
                                                                    <label htmlFor="zipcode" className="form-label">Zipcode<span className='text-danger'>*</span></label>
                                                                </div>
                                                                <input type='text' id='zipcode' value={zipcode} placeholder='Enter Zipcode' className={`form-control ${(!zipcode && !formValid) && 'border-bottom border-danger'}`} onChange={handleZipcodeChange} style={{ border: 'none', borderBottom: '1px solid gray', borderRadius: '0' }}></input>
                                                            </div>
                                                        </div>
                                                    </div>
                                                    {/* Add more columns for additional sections */}

                                                    {/* Home Address Section */}

                                                    <div className="col-lg-6  mx-auto ">
                                                        <div className="text-left">
                                                            <p className='PersonalPass' style={{ margin: '0' }}>Event Details</p><hr className='Personal Personal--line' style={{ margin: '0' }} />

                                                            {/* Event Details Fields */}
                                                            {/* Date of Event */}
                                                            <div className="text-center mt-3">
                                                                <div className='text-left'>
                                                                    <label htmlFor="dateOfEvent" className="form-label">Date of Event<span className='text-danger'>*</span></label>
                                                                </div>
                                                                <input type='date' id='dateOfEvent' value={dateOfEvent} className={`form-control ${(!dateOfEvent && !formValid) && 'border-bottom border-danger'}`} onChange={(e) => setDateOfEvent(e.target.value)} style={{ border: 'none', borderBottom: '1px solid gray', borderRadius: '0' }}></input>
                                                            </div>
                                                            {/* Number of People */}
                                                            <div className="text-center">
                                                                <div className='text-left mt-3'>
                                                                    <label htmlFor="numberOfPeople" className="form-label">Number of People<span className='text-danger'>*</span></label>
                                                                </div>
                                                                <input
                                                                    type='number'
                                                                    id='numberOfPeople'
                                                                    value={numberOfPeople}
                                                                    placeholder='Enter Number of People'
                                                                    className={`form-control ${(!numberOfPeople && !formValid) && 'border-bottom border-danger'}`}
                                                                    onChange={(e) => {
                                                                        const inputValue = parseInt(e.target.value);
                                                                        if (!isNaN(inputValue) && inputValue >= 0) {
                                                                            setNumberOfPeople(inputValue);
                                                                        }
                                                                    }}
                                                                    style={{ border: 'none', borderBottom: '1px solid gray', borderRadius: '0' }}
                                                                />
                                                            </div>

                                                            {/* Meal Time */}
                                                            <div className="text-center">
                                                                <div className='text-left mt-3'>
                                                                    <label htmlFor="mealTime" className="form-label">Meal Time<span className='text-danger'>*</span></label>
                                                                </div>
                                                                <select
                                                                    className={`form-control mb-2 ${(!mealTime && !formValid) && 'border-bottom border-danger'}`}
                                                                    aria-label="Meal Time"
                                                                    value={mealTime}
                                                                    onChange={(e) => setMealTime(e.target.value)}
                                                                    style={{ border: 'none', borderBottom: '1px solid gray', borderRadius: '0' }}
                                                                >
                                                                    <option value="">Select Meal Time</option>
                                                                    <option value="Breakfast">Breakfast</option>
                                                                    <option value="Lunch">Lunch</option>
                                                                    <option value="Dinner">Dinner</option>
                                                                </select>
                                                            </div>
                                                            {/* Type of Cuisine */}
                                                            <div className="text-center">
                                                                <div className='text-left mt-3'>
                                                                    <label htmlFor="cuisineType" className="form-label">Type of Cuisine<span className='text-danger'>*</span></label>
                                                                </div>
                                                                <select
                                                                    className={`form-control mb-2 ${(!cuisineType && !formValid) && 'border-bottom border-danger'}`}
                                                                    aria-label="CuisineType"
                                                                    value={cuisineType}
                                                                    onChange={(e) => setCuisineType(e.target.value)}
                                                                    style={{ border: 'none', borderBottom: '1px solid gray', borderRadius: '0' }}
                                                                >
                                                                    <option value="">Select Cuisine Type</option>
                                                                    <option value="South Indian">South Indian</option>
                                                                    <option value="North Indian">North Indian</option>
                                                                    <option value="Custom">Custom</option>
                                                                </select>
                                                            </div>
                                                            {/* Food Items to be Catered */}
                                                            <div className="text-center">
                                                                <div className='text-left mt-3'>
                                                                    <label htmlFor="foodItems" className="form-label">Food items to be catered<span className='text-danger'>*</span>
                                                                        <span className="text-primary " style={{ cursor: 'pointer' }} onClick={handleDownloadPDF}>   (Available Items)</span>
                                                                    </label>
                                                                </div>
                                                                <textarea
                                                                    id='foodItems'
                                                                    value={foodItems}
                                                                    placeholder='Specify the items you would like to order'
                                                                    className={`form-control ${(!foodItems && !formValid) && 'border-bottom border-danger'}`}
                                                                    onChange={(e) => setFoodItems(e.target.value)}
                                                                    style={{ border: 'none', borderBottom: '1px solid gray', borderRadius: '0' }}
                                                                />
                                                            </div>
                                                            {/* Spice Level */}
                                                            <div className="text-center">
                                                                <div className='text-left mt-3'>
                                                                    <label htmlFor="spiceLevel" className="form-label">Spice Level<span className='text-danger'>*</span></label>
                                                                </div>
                                                                <select
                                                                    className={`form-control mb-2 ${(!spiceLevel && !formValid) && 'border-bottom border-danger'}`}
                                                                    aria-label="SpiceLevel"
                                                                    value={spiceLevel}
                                                                    onChange={(e) => setSpiceLevel(e.target.value)}
                                                                    style={{ border: 'none', borderBottom: '1px solid gray', borderRadius: '0' }}
                                                                >
                                                                    <option value="">Select Spice Level</option>
                                                                    <option value="Mild">Mild</option>
                                                                    <option value="Medium">Medium</option>
                                                                    <option value="Hot">Hot</option>
                                                                    <option value="Extra Hot">Extra Hot</option>
                                                                </select>
                                                            </div>
                                                            {/* Pick up/ Delivery Time */}
                                                            <div className="text-center">
                                                                <div className='text-left mt-3'>
                                                                    <label htmlFor="deliveryType" className="form-label">Pick up/ Delivery (extra charges apply for delivery)<span className='text-danger'>*</span></label>
                                                                </div>
                                                                <select
                                                                    id='deliveryType'
                                                                    value={deliveryType}
                                                                    className={`form-control ${(!deliveryType && !formValid) && 'border-bottom border-danger'}`}
                                                                    onChange={handleDeliveryTypeChange}
                                                                    style={{ border: 'none', borderBottom: '1px solid gray', borderRadius: '0' }}
                                                                >
                                                                    <option value="">Select an option</option>
                                                                    <option value="Pickup">Pickup</option>
                                                                    <option value="Delivery">Delivery</option>
                                                                </select>
                                                                {(!deliveryType && !formValid) && (
                                                                    <div className='text-danger'>*Please select an option</div>
                                                                )}

                                                                {/* Conditionally render additional fields based on the selected delivery type */}
                                                                {(deliveryType === "Delivery" || deliveryType === "Pickup") && (
                                                                    <div>
                                                                        {/* Add your additional fields here */}
                                                                        <div className="text-left mt-3">
                                                                            <label htmlFor="deliveryTime" className="form-label">Pick up/ Delivery Time<span className='text-danger'>*</span></label>
                                                                            <input type="time" id="deliveryTime"  className={`form-control ${(!deliveryPickTime && !formValid) && 'border-bottom border-danger'}`} value={deliveryPickTime} onChange={handleDeliveryTimeChange} style={{ border: 'none', borderBottom: '1px solid gray', borderRadius: '0' }} />
                                                                        </div>
                                                                        {/* Add more additional fields as needed */}
                                                                    </div>
                                                                )}
                                                            </div>
                                                            {/* Enter Your Name */}
                                                            <div className="text-center">
                                                                <div className='text-left mt-3'>
                                                                    <label htmlFor="Name" className="form-label">Enter Your Name<span className='text-danger'>*</span></label>
                                                                </div>
                                                                <input
                                                                    type='text'
                                                                    id='Name'
                                                                    value={Name}
                                                                    placeholder='Enter Your Name'
                                                                    className={`form-control mb-2 ${(!Name && !formValid) && 'border-bottom border-danger'}`}
                                                                    onChange={(e) => setName(e.target.value)}
                                                                    style={{ border: 'none', borderBottom: '1px solid gray', borderRadius: '0' }}
                                                                />
                                                            </div>
                                                        </div>
                                                        <div className="text-left mt-5">
                                                            <p className='PersonalPass' style={{ margin: '0' }}>Comments</p><hr className='Personal Personal--line' style={{ margin: '0' }} />

                                                            {/* Comments Field */}
                                                            <div className="text-center mt-3">
                                                                <div className='text-left'>
                                                                    <label htmlFor="comments" className="form-label">Comments</label>
                                                                </div>
                                                                <textarea
                                                                    id='comments'
                                                                    value={comments}
                                                                    placeholder='Enter your comments here'
                                                                    className="form-control"
                                                                    onChange={(e) => setComments(e.target.value)}
                                                                    style={{ border: '1px solid gray', borderRadius: '5px', minHeight: '100px', padding: '5px' }}
                                                                />
                                                            </div>
                                                        </div>
                                                    </div>
                                                </div>
                                                <div className="text-center mt-5">
                                                    <div className='text-left'>
                                                        <label htmlFor="state" className="form-label"></label>
                                                    </div>
                                                    <button id='submitBtn' onClick={handleSubmit} className="bg-blue-950 w-28 p-2 text-white rounded-md">Submit</button>
                                                </div>
                                            </div>
                                        </div>
                                    </div>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
            <div>
                <Footer/>
            </div>
            {showModal && (
                <div className="modal fade show " tabIndex="-1" role="dialog" style={{ display: 'block' }}>
                    <div className="modal-dialog modal-dialog-centered" role="document">
                        <div className="modal-content">
                            <div className="modal-header">
                                <button type="button" className="btn-close bg-white" aria-label="Close" onClick={closeModal}></button>
                            </div>
                            <div className="modal-body">
                                <form >
                                    <div className="form-group">
                                        <label className="form-label pripass">Thank you for choosing JSS Spiritual Mandir for your event needs. Our team will review your request and reach out to you shortly. We appreciate your trust in us and look forward to serving you.</label>

                                    </div>

                                </form>
                            </div>

                        </div>
                    </div>
                </div>
            )}

        </>
    )
}

export default CateringReqForm 